import "./index.css";

const person = {
  nombre: "Rimuru",
  apellido: "Tempest",
  nombreCompleto: `${person.nombre} ${person.apellido}`,
  edad: "2",
  direccion: {
    region: "Jura Tempest",
    ciudad: "Ciudad de Rimuru",
  },
  ocupacion: "Demon Lord",
  saludo: `Hola! soy ${this.nombreCompleto}, no soy un slime malo!`,
};

console.log(person);
console.table(person);
